import { items, ItemsNavbar } from "./items";
import "./styles.css";
export const Navbar = () => {
  return (
    <div>
      <main className="navbar">
        <ul className="nav-ul">
          <li className="nav-items">
            <a className="nav-links">Navbar</a>
          </li>
          {items.map((value: ItemsNavbar) => (
            <li className="nav-items" key={value.label}>
              <a className="nav-links">{value.label}</a>
            </li>
          ))}
        </ul>
        <ul className="nav-ul">
          <li className="nav-items-left">
            <a className="nav-links">Sign out</a>
          </li>
        </ul>
      </main>
    </div>
  );
};
